INSERT INTO `npc_text` SET `ID`=12789,`prob0`=1,`text0_0`='',`text0_1`='We will never forget your bravery, $N. You are always welcome in Wintergarde.$B$BWould you like to make this inn your home?',`lang0`=0,`em0_0`=0,`em0_1`=1,`em0_2`=3,`em0_3`=2,`em0_4`=0,`em0_5`=0;
INSERT INTO `npc_text` SET `ID`=14634,`prob0`=1,`text0_0`='',`text0_1`='Welcome! Have you come to join us for a Pilgrim''s Bounty feast? Please, have a seat at a Bountiful Table.$B$BTry everything! I''m certain you''ll find something to your liking.',`lang0`=0,`em0_0`=0,`em0_1`=3,`em0_2`=2,`em0_3`=1,`em0_4`=0,`em0_5`=0;
INSERT INTO `npc_text` SET `ID`=14628,`prob0`=1,`text0_0`='If you''re interested in learning more about the traditional Pilgrim''s Bounty feast, speak to any of the hostesses.',`text0_1`='',`lang0`=0,`em0_0`=0,`em0_1`=0,`em0_2`=0,`em0_3`=0,`em0_4`=0,`em0_5`=0;
INSERT INTO `npc_text` SET `ID`=14627,`prob0`=1,`text0_0`='Hello, $N. If you''re looking for cooking training, you''ve come to the right place. I usually get lots of new students when Pilgrim''s Bounty rolls around.',`text0_1`='Hello, $N. If you''re looking for cooking training, you''ve come to the right place. I usually get lots of new students when Pilgrim''s Bounty rolls around.',`lang0`=0,`em0_0`=0,`em0_1`=0,`em0_2`=0,`em0_3`=0,`em0_4`=0,`em0_5`=0;
INSERT INTO `npc_text` SET `ID`=14647,`prob0`=1,`text0_0`='',`text0_1`='A Bountiful Table is laid out with five Pilgrim''s Bounty foods, one in front of each chair.$B$BWhile in a chair, you may eat as much of that food as you like, as well as pass servings of that food to the other chairs. Feast and share with friends!$B$BIf you eat enough of any one food, you''ll gain benefits unique to that food.$B$BIn addition, if you eat enough of every food, you''ll gain the Spirit of Sharing!',`lang0`=0,`em0_0`=0,`em0_1`=1,`em0_2`=3,`em0_3`=21,`em0_4`=3,`em0_5`=1;
